import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "Bryan Ge | Portfolio",
      headerLinks: [
        { title: 'Home', path: '/'},
        { title: 'About', path: '/about'},
        { title: 'Resume', path: 'https://drive.google.com/file/d/1H4-sfzxQG9cpSsKMzuQUFK3NX5h8d0V5/view?usp=sharing'}
      ],
      home: {
        title: 'Hi! I\'m Bryan Ge.',
        subTitle: 'I am a freshman studying CS + Statistics at UIUC.',
      },
      about: {
        title: 'About Me'
      }
    }
  }

  render() {
    return (
      <div>Hello from React!</div>
    );
  }
}

export default App;
